<html lang="en">

  <title>Debug Map - test_generation</title>

  <style>
    @import url('https://fonts.googleapis.com/css2?family=JetBrains+Mono:wght@400;600&family=Space+Grotesk:wght@400;600&display=swap');

    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      font-family: 'Space Grotesk', sans-serif;
      background: #0a0a0f;
    }

    #map {
      width: 100vw;
      height: 100vh;
    }

    .info-panel {
      position: fixed;
      top: 16px;
      right: 16px;
      background: rgba(10, 10, 15, 0.92);
      backdrop-filter: blur(12px);
      border: 1px solid rgba(255, 255, 255, 0.1);
      border-radius: 12px;
      padding: 16px 20px;
      color: #fff;
      min-width: 180px;
      z-index: 1000;
      box-shadow: 0 8px 32px rgba(0, 0, 0, 0.4);
    }

    .info-panel h3 {
      font-family: 'JetBrains Mono', monospace;
      font-size: 11px;
      font-weight: 600;
      text-transform: uppercase;
      letter-spacing: 1.5px;
      color: rgba(255, 255, 255, 0.5);
      margin-bottom: 8px;
    }

    .coords {
      font-family: 'JetBrains Mono', monospace;
      font-size: 28px;
      font-weight: 600;
      color: #fff;
      display: flex;
      gap: 8px;
      align-items: baseline;
    }

    .coords .label {
      font-size: 14px;
      color: rgba(255, 255, 255, 0.4);
    }

    .coords .x {
      color: #ff6b6b;
    }

    .coords .y {
      color: #4ecdc4;
    }

    .coords .separator {
      color: rgba(255, 255, 255, 0.3);
      font-size: 20px;
    }

    .no-hover {
      font-family: 'JetBrains Mono', monospace;
      font-size: 14px;
      color: rgba(255, 255, 255, 0.3);
      font-style: italic;
    }

    .stats-panel {
      position: fixed;
      bottom: 16px;
      left: 16px;
      background: rgba(10, 10, 15, 0.92);
      backdrop-filter: blur(12px);
      border: 1px solid rgba(255, 255, 255, 0.1);
      border-radius: 12px;
      padding: 14px 18px;
      color: #fff;
      z-index: 1000;
      box-shadow: 0 8px 32px rgba(0, 0, 0, 0.4);
    }

    .stats-panel .title {
      font-size: 14px;
      font-weight: 600;
      margin-bottom: 4px;
    }

    .stats-panel .count {
      font-family: 'JetBrains Mono', monospace;
      font-size: 12px;
      color: rgba(255, 255, 255, 0.6);
    }

    .legend {
      position: fixed;
      bottom: 16px;
      right: 16px;
      background: rgba(10, 10, 15, 0.92);
      backdrop-filter: blur(12px);
      border: 1px solid rgba(255, 255, 255, 0.1);
      border-radius: 12px;
      padding: 14px 18px;
      color: #fff;
      z-index: 1000;
      box-shadow: 0 8px 32px rgba(0, 0, 0, 0.4);
      display: flex;
      flex-direction: column;
      gap: 8px;
    }

    .legend-item {
      display: flex;
      align-items: center;
      gap: 10px;
      font-size: 12px;
    }

    .legend-swatch {
      width: 16px;
      height: 16px;
      border-radius: 4px;
    }

    .legend-swatch.quadrant {
      background: rgba(255, 107, 107, 0.35);
      border: 2px solid rgba(255, 107, 107, 0.7);
    }

    .legend-swatch.water {
      background: rgba(59, 130, 246, 0.35);
      border: 2px solid rgba(59, 130, 246, 0.7);
    }

    .legend-swatch.protected {
      background: rgba(220, 38, 38, 0.25);
      border: 2px dashed rgba(220, 38, 38, 0.7);
    }

    .legend-swatch.seed {
      background: #10b981;
      border: 2px solid #fff;
      border-radius: 50%;
    }

    .legend-swatch.nyc-boundary {
      background: rgba(59, 130, 246, 0.15);
      border: 2px solid rgba(59, 130, 246, 0.7);
    }
  </style>
</head>

      style: nycBoundaryStyle
    }).addTo(map);

    const coordsDisplay = document.getElementById('coords-display');

    // Style for normal state (red for land)
    const normalStyle = {
      fillColor: '#ff6b6b',
      fillOpacity: 0.25,
      color: '#ff6b6b',
      weight: 1.5,
      opacity: 0.6
    };

    // Style for hover state (land)
    const hoverStyle = {
      fillColor: '#ff6b6b',
      fillOpacity: 0.5,
      color: '#fff',
      weight: 2,
      opacity: 1
    };

    // Style for water tiles (blue)
    const waterStyle = {
      fillColor: '#3b82f6',
      fillOpacity: 0.35,
      color: '#3b82f6',
      weight: 1.5,
      opacity: 0.7
    };

    // Style for water hover state
    const waterHoverStyle = {
      fillColor: '#3b82f6',
      fillOpacity: 0.6,
      color: '#fff',
      weight: 2,
      opacity: 1
    };

    // Style for protected (explicit not water) tiles
    const protectedStyle = {
      fillColor: '#dc2626',
      fillOpacity: 0.2,
      color: '#dc2626',
      weight: 1.5,
      opacity: 0.6,
      dashArray: '5, 5'
    };

    // Style for protected hover state
    const protectedHoverStyle = {
      fillColor: '#dc2626',
      fillOpacity: 0.4,
      color: '#fff',
      weight: 2,
      opacity: 1,
      dashArray: '5, 5'
    };

    // Helper to get style based on water_status
    function getStyle(waterStatus) {
      if (waterStatus === 1) return waterStyle;
      if (waterStatus === -1) return protectedStyle;
      return normalStyle;
    }

    function getHoverStyle(waterStatus) {
      if (waterStatus === 1) return waterHoverStyle;
      if (waterStatus === -1) return protectedHoverStyle;
      return hoverStyle;
    }

    // Add quadrant polygons
    quadrants.forEach(q => {
      const style = getStyle(q.water_status);
      const hStyle = getHoverStyle(q.water_status);
      const polygon = L.polygon(q.corners, style).addTo(map);

      polygon.on('mouseover', function(e) {
        this.setStyle(hStyle);
        let statusLabel = '';
        if (q.water_status === 1) {
          statusLabel = ' <span style="color: #3b82f6;"></span>';
        } else if (q.water_status === -1) {
          statusLabel = ' <span style="color: #dc2626;"></span>';
        }
        coordsDisplay.innerHTML = `
          <div class="coords">
            <span class="label">x:</span><span class="x">${q.x}</span>
            <span class="separator">,</span>
            <span class="label">y:</span><span class="y">${q.y}</span>
            ${statusLabel}
          </div>
        `;
      });

      polygon.on('mouseout', function(e) {
        this.setStyle(style);
        coordsDisplay.innerHTML = '<span class="no-hover">Hover over a tile</span>';
      });
    });

    // Add seed point marker
    const seedIcon = L.divIcon({
      className: 'seed-marker',
      html: `<div style="
        width: 14px;
        height: 14px;
        background: #10b981;
        border: 3px solid #fff;
        border-radius: 50%;
        box-shadow: 0 2px 8px rgba(0,0,0,0.4);
      "></div>`,
      iconSize: [14, 14],
      iconAnchor: [7, 7]
    });

    L.marker([seedLat, seedLng], { icon: seedIcon })
      .addTo(map)
      .bindPopup('Seed Point');

    // Fit map to quadrant bounds if we have quadrants
    if (quadrants.length > 0) {
      const allLatLngs = quadrants.flatMap(q => q.corners);
      const bounds = L.latLngBounds(allLatLngs);
      map.fitBounds(bounds.pad(0.1));
    }
  </script>
</body>
</html>
